import React, { Component } from 'react';
import {Jumbotron, Grid, Row, Col, Image, Button} from 'react-bootstrap';
import './About.css'


class About extends Component {
  render() {
    return (
      <div>
        <h1>About page</h1>
      </div>
    );
  }
}

export default About;
